SELECT MAX("upravna_enota"."id_upravna_enota" + "nesreca"."upravna_enota") as agg_0 FROM "nesreca" LEFT OUTER JOIN "oseba" ON "nesreca"."id_nesreca" = "oseba"."id_nesreca" LEFT OUTER JOIN "upravna_enota" ON "nesreca"."upravna_enota" = "upravna_enota"."id_upravna_enota"  WHERE "oseba"."vozniski_staz_MM" BETWEEN 3.3922185099459865 AND 7.487000261629161 AND "upravna_enota"."ime_upravna_enota" LIKE '%pr%i%'